import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import Results from "./components/Results";

import Select from "./components/Select";

function App() {
  return (
    <Router>
      <Select />
      <Switch>
        <Route path="/:state" children></Route>
        <Results/>
      </Switch>
    </Router>
  );
}

export default App;
